        {

          id: 3,
          title: "omnis laborum odio",
           // img:
         desc: "quidem molestiae enim",
         category: 'chairs',
          price: '49.99'
        },
        {

          "id": 4,
          "title": "non esse culpa molestiae omnis sed optio"
        },
        {

          "id": 5,
          "title": "eaque aut omnis a"
        },
        {
          "id": 6,
          "title": "natus impedit quibusdam illo est"
        },
    ]
  }
}


render() {

  return (
    <div className="wrapper">
      <Header />
      <Footer />
    </div>
  )
}

}

export default App;
